import React from "react";

const AidanBayerCalvert: React.FC = () => {
  return (
    <div className="team-member">
      <h1>Aidan Bayer-Calvert</h1>
      <h2>Back-end Lead</h2>
      <p>
        Aidan is a back-end lead, working closely with Ryan to ensure seamless
        server-side functionality and data management.
      </p>
      <p>
        Hi everyone! I'm a senior majoring in Computer Science with a minor in
        Computing Applications. When I'm not coding, I enjoy cooking, playing
        soccer, staying active at the gym, and spending time with my family and
        friends.
      </p>
      {/* <img
        src="path to image"
        alt="img"
      /> */}
    </div>
  );
};

export default AidanBayerCalvert;
